(30, 31, 10, 8, '«Мадонна» — настоящее имя артистки, а «Вероника» было выбрано самой певицей в детстве для конфирмации, и оно не является официальным. С 2001 Мадонна является подданной Соединённого Королевства. Самая коммерчески преуспевающая певица, продавшая наибольшее количество своих записей среди всех женщин-исполнительниц: более 250 миллионов альбомов и 100 миллионов синглов, заслуженно носящая звание «Королевы поп-музыки»[1].\n\nМадонна начала свою музыкальную карьеру в 1979 году как барабанщица в нью-йоркской рок-группе своего приятеля Дэна Гилроя Breakfast Club, вскоре перейдя к гитаре, вокалу и сочинению собственного материала. За годы своей музыкальной деятельности Мадонна пробовала себя в разных жанрах и направлениях, стала лауреатом множества наград, в том числе Грэмми (7 наград из 28 номинаций). В 1998 году Мадонна была включена в «Книгу рекордов Гиннеса»[2] как обладательница самой длинной непрерывной серии синглов, вошедших в первую «десятку» (с Like a virgin (1984) по Secret (1994)), также Мадонна в 2008 году обогнала Элвиса Пресли по общему количеству хитов в первой «десятке», и по этому показателю стала второй, уступая лишь «Битлз». По сообщению звукозаписывающей компании Мадонны Warner Brothers Records в 2005 году мировые продажи её альбомов превысили 250 миллионов экземпляров. В 2008 году она была включена в «Зал славы рок-н-ролла».\n\nОт англоязычной прессы Мадонна получила прозвища «Материалистка» (англ. Material Girl) и «Королева поп-музыки» (англ. Queen of Pop). Она известна также как последовательница и популяризатор каббалы, активистка многих благотворительных и правозащитных организаций, одной из которых является «Возрождение Малави» (англ.)русск..\n\nХотя актёрская карьера Мадонны сложилась менее удачно, чем музыкальная (она стала рекордсменом по количеству антипремий «Золотая малина за худшую роль»), она снялась более чем в двадцати фильмах и удостоилась за свою игру в кино-мюзикле «Эвита» престижной премии Ассоциации иностранной прессы Голливуда «Золотой глобус». Также Мадонна озвучивала принцессу Селению в англоязычной версии дубляжа фильма Люка Бессона «Артур и минипуты» (в оригинальной, французской версии фильма Принцессу озвучивала Милен Фармер).', 1, 0, 0, 0, 0, 0, 1359459664),
